INSERT INTO `comment` VALUES (324,150,'Thank you,\nIt\'s a good idea and we had the same requests from few people.\nWe leave it on voting. Maybe will add to our roadmap later.',NULL,0,'2015-08-31 17:19:50',NULL,1,0,4,0,NULL,NULL),(325,150,'Has there been any further consideration of this request? This request is becoming more important for us. If we are to really use UserEcho in production, we need the option for daily digest/summary emails.',NULL,0,'2015-08-31 17:19:50',NULL,2,0,1,3,NULL,NULL),(327,150,'Also check this community for example, they have first page that pointing to their products http://reach.jdbpocketware.com/',NULL,NULL,'2015-09-03 05:46:34',NULL,2,0,2,3,NULL,NULL),(329,150,'@sergey this is indeed what I\'m looking for. But they \'misused\' the system a bit by creating a \'Welcome\' forum. For me that\'s fine too. I just tried adding one but I get that I\'m at the maximum? Which is strange because I don\'t believe there was a limit on them?',NULL,NULL,'2015-09-03 05:46:34',NULL,1,0,5,3,NULL,NULL),(330,150,'Hello,\nYou have a \"Base+\" service plan which include 10 forums only. If you would like we can switch you to the \"Universal\" plan. It include unlimited forums, but priced by support agents http://userecho.com/pricing/',NULL,NULL,'2015-09-03 05:46:34',NULL,1,0,1,3,NULL,NULL),(331,150,'Pellentesque scelerisque vitae mi quis sollicitudin. Sed pellentesque nulla eleifend hendrerit rhoncus. Aenean rhoncus imperdiet pretium. Nunc vitae egestas eros, vel fringilla arcu. Duis vel libero sit amet metus faucibus venenatis in sit amet nisl. Fusce imperdiet enim risus. Cras orci velit, tempor dignissim ante eget, rhoncus hendrerit nisi.',NULL,NULL,'2015-09-03 05:46:34',NULL,1,0,1,3,NULL,NULL),(332,150,'We implement full screen editing soon.\n\nAnd also we try to stick menu bar to the top of the popup when content scroll down.',NULL,NULL,'2015-09-03 05:46:34',NULL,1,331,3,3,NULL,NULL),(333,150,'How was trip?',NULL,NULL,'2015-09-03 05:46:34',NULL,2,330,1,3,NULL,NULL),(334,150,'In fullscreen mode toolbar has fixed postion.',NULL,NULL,'2015-09-03 05:46:34',NULL,2,333,1,3,NULL,NULL),(335,150,'Chiled comment  e rewr ew rew',NULL,NULL,'2015-09-03 05:46:34',NULL,2,332,3,3,NULL,NULL),(336,150,'e rewr ew rew',NULL,NULL,'2015-09-03 05:46:34',NULL,1,336,0,3,NULL,NULL),(337,150,'I\'m incredibly excited to announce that I am joining the amazing @Unify team. To be in touch with the latest update, Sign up and get your own Account page fee free :) Like mine: http://www.unify.com/flennon',NULL,NULL,'2013-09-03 04:46:34',NULL,1,0,3,3,NULL,NULL),(338,150,'Welcome to Board! :) Your journey starts here. Wish you all the best!',NULL,NULL,'2015-09-03 05:46:34',NULL,1,0,3,3,NULL,NULL),(339,150,'Thank you,',NULL,NULL,'2015-09-03 05:46:34',NULL,1,0,2,3,NULL,NULL),(340,150,'Has there been any further consideration of this request? This request is becoming more important for us. If we are to really use UserEcho in production, we need the option for daily digest/summary emails.',NULL,1,'2015-09-02 14:56:37','2015-09-02 14:56:37',1,0,2,3,NULL,NULL),(345,150,'Have you considered this feature recently? It now has 26 votes ... that seems like a fair amount of interest. Here is a quote that one of our users posted in our forum today (about receiving a daily digest):',NULL,NULL,'2015-09-03 05:46:34',NULL,1,0,3,3,NULL,NULL),(346,150,'Hello Mathew,\nThank you for your request again. We are starting to implement this feature.',NULL,NULL,'2015-09-03 05:46:34',NULL,2,0,2,3,NULL,NULL),(347,150,'Great piece of news.\nIs another parameter than \"daily\" considered in the user preferences? (maybe \"weekly\" for instance)',NULL,1,'2015-09-03 10:07:21','2015-09-03 10:07:21',NULL,0,1,3,NULL,NULL),(348,150,'I would also like to see the weekly option. Any guess at when this might be implemented?',NULL,1,'2015-02-03 10:14:29','2015-09-03 10:14:29',NULL,0,-8,3,NULL,NULL),(349,150,'I would also like to see the weekly option. Any guess at when this might be implemented?',NULL,1,'2011-09-03 09:28:03','2015-09-03 10:28:03',NULL,324,5,1,NULL,NULL),(419,150,'fdsaf dsf ds',NULL,1,'2015-09-17 20:27:20','2015-09-17 20:27:20',2,348,NULL,3,NULL,NULL),(447,150,'sad sad  sa dsa dsa',NULL,1,'2015-09-18 10:23:28','2015-09-18 10:23:28',2,419,NULL,3,NULL,NULL),(448,150,'ssssssssssssss',NULL,1,'2015-09-18 10:23:46','2015-09-18 10:23:46',2,419,NULL,3,NULL,NULL),(449,150,'66666666666666666',NULL,1,'2015-09-18 10:26:58','2015-09-18 10:26:58',2,448,NULL,3,NULL,NULL),(450,150,'sad sad sad sad sad sa',NULL,1,'2015-09-18 10:30:09','2015-09-18 10:30:09',2,449,NULL,3,NULL,NULL),(451,150,'sdsad sad sad sad sad sa',NULL,1,'2015-09-18 10:35:02','2015-09-18 10:35:02',2,334,NULL,3,NULL,NULL),(452,150,'df dsf dsf ds',NULL,1,'2015-09-18 11:38:40','2015-09-18 11:38:40',2,324,NULL,1,NULL,NULL),(453,150,'df dsf dsf dsf d',NULL,1,'2015-09-18 11:40:01','2015-09-18 11:40:01',2,349,NULL,3,NULL,NULL),(454,150,'df dsf dsf dsf d',NULL,1,'2015-09-18 11:40:01','2015-09-18 11:40:01',2,349,NULL,3,NULL,NULL),(455,150,'',NULL,1,'2015-09-18 11:43:17','2015-09-18 11:43:17',2,324,NULL,2,NULL,NULL),(456,150,'',NULL,1,'2015-09-18 11:51:06','2015-09-18 11:51:06',2,349,NULL,3,NULL,NULL),(457,150,'rt ret ',NULL,1,'2015-09-18 11:53:32','2015-09-18 11:53:32',2,451,NULL,3,NULL,NULL),(458,150,'rt ret ',NULL,1,'2015-09-18 11:53:23','2015-09-18 11:53:23',2,451,NULL,3,NULL,NULL),(459,150,'rt ret ',NULL,1,'2015-09-18 11:54:26','2015-09-18 11:54:26',2,451,NULL,3,NULL,NULL),(461,150,'dsf dsf dsf ds',NULL,1,'2015-09-18 18:18:09','2015-09-18 18:18:09',NULL,455,NULL,3,NULL,NULL),(462,150,'dfdsf dsf dsf d',NULL,1,'2015-09-18 18:32:44','2015-09-18 18:32:44',2,454,NULL,3,NULL,NULL),(463,150,'fgdsg fg fg df',2,1,'2015-09-18 19:09:06','2015-09-18 19:09:06',2,454,NULL,3,NULL,NULL),(464,150,'dsfds fdsfds',3,1,'2015-09-19 10:36:10','2015-09-19 10:36:10',2,461,NULL,3,NULL,NULL),(465,150,'fdsfdsf ds',3,1,'2015-09-19 11:12:32','2015-09-19 11:12:32',2,327,NULL,4,NULL,NULL),(466,150,'',1,1,'2015-09-19 11:34:49